import React from "react";
import { Routes, Route, BrowserRouter } from "react-router-dom";

import Index from "../screens/index";

const Router = () => {
    return (
        <BrowserRouter>
                <Route>
                    <Route index component={Index} exact />
                </Route>
        </BrowserRouter>
    )
}

export default Router;
